window.bookSummaryJSON = "<p>He wanted me for my blood....</p> <p>Living on the run was all I'd ever known. My life was unstable, but at least I wasn't alone. That all changed when my mother was murdered.</p> <p>I ran from the unknown creatures she'd always feared until the day I stopped being afraid. That was my first mistake.</p> <p>Cashel Blackthorne took me as his captive, but more than that, he opened my eyes to the terrible truth of the world.</p> <p>Vampires exist, and I am the key to their salvation.</p> <p>The Blackthorne vampires need my blood, but their prince desires more - me. There's something between us neither of us can deny. He is my captor, but I'll be his ruin.</p> <p>Contains mature themes.</p>"; 
